const deleteItemGarageListStatuses = ( id ) => {
   const data = JSON.parse( sessionStorage.getItem('garageListStatuses') );
   
   delete data[ id ];

   sessionStorage.setItem('garageListStatuses', JSON.stringify( data ) );
}

const changeItemGarageListStatuses = ( id, newValue ) => {
   const data = JSON.parse( sessionStorage.getItem('garageListStatuses') );

   data[ id ] = newValue;

   sessionStorage.setItem('garageListStatuses', JSON.stringify( data ) );
}

export {
   deleteItemGarageListStatuses,
};
